message:
Até a virada, NINGUÉM prende o atual Pr. 

O que pode acontecer é somente  algum general omitir-se da liderança e não acatar a ordem; 

Ele deixou claro,
Só dará errado se ele perder a liderança;

Agora, 
Movimento do NiNE,


Ou, 
Ele está tentando corrigir os pedidos e todo esse momento calado foi esperando a galera ir lá no portão da casinha dele; 

Ou, 
Está tentando inviabilizar qualquer ação que possa ser tomada em função da galera na esplanada não aceitando a diplomação do vagamundo, usando isso contra as ações dele até o momento; 

Visão de prisão; 
Não tem fundamento! 

Até mesmo porque; 
Um cavalo de pau no brasil hoje, seria bem estrondoso; nível interno ou externo…  mesmo que a mídia tenha criado uma narrativa durante anos! 

Existem os que estão aqui; 🧐

Entenda; 
É mais simples…

Pois se você tem o cpf,, logo consegue nome completo e data de nascimento e nome da mãe; 

Com estes dados, 
Você consegue os dados de local de votação, zona, sessão.

Juntando isso com sua intenção de voto; 

Tudo junto, 
Passa ser uma informação que vale a pena para uma intenção. 🧐
